import React, { Component } from 'react';
import './NaviMenu.css';

function NaviMenu({gitathonLogo, userName, hackathonLogo, profileLogo}){

  return (
    <div className="NaviMenu">
      <div className = "GitathonLogo">
        <ShowLogo logoPath = {gitathonLogo} />
      </div>
      <div className = "UserName">
        <Welcome name = {userName}/>
      </div>
      <div className = "HackathonLogo">
        <ShowLogo logoPath = {hackathonLogo} />
      </div>
      <div className = "profileLogo">
        <ShowLogo logoPath = {profileLogo} />
      </div>
    </div>
  )
}

function Welcome({name}){
  return(
    <span className = "Welcoming">
      <font color = "purple">{name} </font> 님 환영합니다!!
    </span>
  )
}

function ShowLogo({logoPath}) {
    console.log({logoPath})
    return(
      <img src = {logoPath} className = "Movie__Poster" />
    )
}

export default NaviMenu;
